//------------------------------------------------------------------------------
/// Creation function of the heuristic
//------------------------------------------------------------------------------
extern "C" Heuristic* new_heuristic() {
	return new PatchHeuristic();
}

/************************* IMPLEMENTATION OF Heuristic ************************/

unsigned int PatchHeuristic::dim() {
	return 512;
}

void PatchHeuristic::prepareForCoordinates() {
	// Compute the coordinates of the top-left pixel of the region of interest
	unsigned int x0 = coordinates.x - roi_extent;
	unsigned int y0 = coordinates.y - roi_extent;

	// Compute the size of the region of interest
	unsigned int roi_size = roi_extent * 2 + 1;

	// Get the pixels values of the image
	RGBPixel_t** pLines = image->rgbLines();

	// Initioalize the histogram
	std::fill_n(&hist_[0], 256,-1000.0f);
	std::fill_n(&hist_[256], 256, 1000.0f);

	// The current patch (normalized)
	float patch[192];

	// Compute the correlation at every pixel
	const unsigned int incr = std::max(roi_extent >> 3, 1U);

	for (unsigned int y = 0; y < roi_size - 7; y += incr) {
		for (unsigned int x = 0; x < roi_size - 7; x += incr) {
			// Compute the mean and standard deviation of the current patch
			float mean = 0.0f, sd = 0.0f;

			for (unsigned int v = 0; v < 8; ++v) {
				for (unsigned int u = 0; u < 8; ++u) {
					float r = pLines[y0 + y + v][x0 + x + u].r / 255.0f;
					float g = pLines[y0 + y + v][x0 + x + u].g / 255.0f;
					float b = pLines[y0 + y + v][x0 + x + u].b / 255.0f;

					mean += r + g + b;
					sd += r * r + g * g + b * b;

					patch[v * 24 + u * 3 + 0] = r;
					patch[v * 24 + u * 3 + 1] = g;
					patch[v * 24 + u * 3 + 2] = b;
				}
			}

			// Process the patch only if its standard deviation is above 0.1
			sd = std::sqrt((sd - mean * mean / 192.0) / 191.0);
			mean /= 192;

			if (sd > 0.1) {
				// Normalize the current patch
				const float invSd = 1.0 / sd;

				for (int i = 0; i < 192; ++i) {
					patch[i] = (patch[i] - mean) * invSd;
				}

				// Unroll it a maximum
				for (int i = 0; i < 256; i += 2) {
					float dot0 = 0.0f;
					float dot1 = 0.0f;

					for (int j = 0; j < 192; j += 4) {
						dot0 += Dict_[i][j] * patch[j] +
								Dict_[i][j + 1] * patch[j + 1] +
								Dict_[i][j + 2] * patch[j + 2] +
								Dict_[i][j + 3] * patch[j + 3];
						dot1 += Dict_[i + 1][j] * patch[j] +
								Dict_[i + 1][j + 1] * patch[j + 1] +
								Dict_[i + 1][j + 2] * patch[j + 2] +
								Dict_[i + 1][j + 3] * patch[j + 3];
					}

					hist_[i] = std::max(hist_[i], dot0);
					hist_[i + 1] = std::max(hist_[i + 1], dot1);
					hist_[i + 256] = std::min(hist_[i + 256], dot0);
					hist_[i + 257] = std::min(hist_[i + 257], dot1);
				}
			}
		}
	}
}

scalar_t PatchHeuristic::computeFeature(unsigned int feature_index) {
	return hist_[feature_index];
}
